import logo from './logo.svg';
import './App.css';
import './header.css';

function App() {
  return (
    <div className="App">
       <h1>Hello</h1>
    </div>
  );
}

function tick() {
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  );
  ReactDOM.render(element, document.getElementById('root'));
}

setInterval(tick, 1000);


export default App;
